import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Dashboard from 'app/templates/Dashboard';
import Configuracoes from 'app/templates/Configuracoes';

class Menu extends Component {
    render() {
        var inputAtivo = document.getElementById(this.props.ativo);
        inputAtivo.classList.add("link-ativo");
        return (
            <Router>
                <div>
                    <aside className="menu">
                        <nav className="itens-menu">
                            <ul>
                                <li id="dashboard"><Link to="/dashboard">Início</Link></li>
                                <li id="configuracoes"><Link to="/configuracoes">Configurações</Link></li>
                            </ul>
                        </nav>
                    </aside>
                    <Route path="/dashboard" component={Dashboard} />
                    <Route path="/configuracoes" component={Configuracoes} />
                </div>
            </Router>
        )
    }
}

export default Menu;
